import Link from 'next/link';
import styled from 'styled-components';

const HeaderWrapper = styled.div`
  background: palevioletred;
  padding: 0.25em 1em;
  margin: 0;
`;

const linkStyle = {
  marginRight: 15,
};

export const Header = () => (
  <div>
    <Link href="/">
      <a style={linkStyle}>Latest posts</a>
    </Link>
    <Link href="/new">
      <a style={linkStyle}>New post</a>
    </Link>
  </div>
);

// export default Header;
